Entry.block.arduino_convert_scale = function(b, a) {
  var e = a.getNumberValue("VALUE1", a), c = a.getNumberValue("VALUE2", a), d = a.getNumberValue("VALUE3", a), f = a.getNumberValue("VALUE4", a), g = a.getNumberValue("VALUE5", a);
  if (c > d) {
    var h = c, c = d, d = h
  }
  f > g && (h = f, f = g, g = h);
  e -= c;
  e *= (g - f) / (d - c);
  e += f;
  e = Math.min(g, e);
  e = Math.max(f, e);
  return Math.round(e);
};
